------------------------------

Christian Louboutin: The World's Most Luxurious Shoes
We see his trademark red-soled shoes with their vertiginous heels everywhere. Well, mainly on the feet of celebs rather than on our own, because they cost around Ã‚Â£600 for an off-the-peg pair. Yet despite the exorbitant price, Louboutin's Milan factory produces around 25,000 pairs a month. 
Cameras follow a year in the life of Christian Louboutin, one of the world's most famous shoe designers, whose stilettos alone can cost up to Ã‚Â£6,000 a pair. Filmmaker Michael Waldman reveals the determination, hard work and creativity that have seen Louboutin revolutionise contemporary footwear, and his attempts to expand his business empire into new super-rich markets in Asia.
Charismatic with a slightly impish way about him, Louboutin is unrepentant about the erotic nature of his designs and shrugs off suggestions they're for men to look at more than women to wear. Comfort is irrelevant to him - as is need. His shoes, he says, are all about desire.

